import React, {Component} from 'react';
import ButtonGroup from '@material-ui/core/ButtonGroup';
import Button from '@material-ui/core/Button';
import {NavLink} from 'react-router-dom';

class Pagination extends Component{
    render(){
        return(
            <React.Fragment>
                <div >
                    <ButtonGroup color="primary" aria-label="outlined primary button group">
                        <Button >
                            <NavLink to = "/home/classrooms" >1- Add Class Rooms</NavLink>
                        </Button>
                        <Button >

                        </Button>
                        <Button >

                        </Button>
                        <Button >

                        </Button>

                        <NavLink to = "/home/classes" >2- Add Classes</NavLink>
                        <NavLink to = "/home/teachers" >3- Add Teachers</NavLink>
                        <NavLink to = "/home/courses" >4- Add Courses</NavLink>
                        {/* <Button onClick={()=> filterOrder('delivered')} variant={delivered} >Delivered</Button> */}
                    </ButtonGroup>
                </div>
            </React.Fragment>
        );
    }
}

export default Pagination;
